import backend_uri from "../backend";

export const getOrders = async () => {
  console.log(backend_uri);
  return fetch(`${backend_uri}/allorders/`, { method: "POST" })
    .then((response) => {
      return response.json();
    })
    .catch((err) => {
      return err;
    });
};
